import styles from './styling/regions.module.css'
import Layout from '../components/layout'
import RegionComponent from '../components/elements/region-gallery/regionComponent'
import SideMenu from '../components/elements/side-menu/sideMenu'
import Link from 'next/link'



// fake data 
const categories = [
    {
        tag: "clothes",
        sous_tags: ["shoes", "t-shirts", "jeans", "socks"],
        tag_image: "images/tags/clothes/clothes-1.jpg"
    },
    {
        tag: "jewlery",
        sous_tags: ["neckchains", "rings", "bracelets", "earrings", "watches"],
        tag_image: "images/tags/jewlery/jewlery-1.jpg"
    },
    {
        tag: "furniture",
        sous_tags: ["tables", "beds", "chair", "sofa", "wardrobes"],
        tag_image: "images/tags/furniture/furniture-1.jpg"
    },
    {
        tag: "gifts",
        sous_tags: ["parfum", "braclet", "socks", "backpack", "necklace", "wallet"],
        tag_image: "images/tags/gifts/gifts-1.jpg"
    }
]

const links = [
    {
        page: 'makers',
        path: '/makers'
    },
    {
        page: 'regions',
        path: '/regions'

    },
    {
        page: 'stories',
        path: '/stories'
    }
]

function Regions() {
    return (
        <Layout>
            <div className="w-full h-40"></div>
            <h1>regions</h1>
            <div className={styles.page_container}>
                <div className={styles.left_menu_container}>
                    <SideMenu />
                </div>
                <div className={styles.cities_container}>
                    <RegionComponent galleryPHotos="/images/region-1.jpg" />
                    <RegionComponent galleryPHotos="/images/region-2.jpg" />
                    <RegionComponent galleryPHotos="/images/region-3.jpg" />
                    <RegionComponent galleryPHotos="/images/region-1.jpg" />
                    <RegionComponent galleryPHotos="/images/region-1.jpg" />
                </div>


            </div>
        </Layout>
    )
}

export default Regions
